const provinces = [
    'Gauteng', 'Western Cape', 'Nothern Cape', 'Mpumalanga', 'Eastern Cape', 'KwaZulu-Natal', 'Limpopo', 'North West', 'Free State'];
  
  export default {
    getProvinces() {
      return provinces;
    }
  };
